import Card from "../UI/Card";
import "./Hotel.css";

const Hotel = (props) => {
  const name = props.name;
  const date = props.date;
  const price = props.price;

  return (
    <div className="Hotel">
      <p>{name}</p>
      <p>{date}</p>
      <p>{price}</p>
    </div>
  );
};
